import React ,{Component} from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import {Navbar,Nav} from 'react-bootstrap';
import './register.css';
class Navi extends Component
{
    render(){
        return (
            <div >
                <div id="menu-nav">
                    <div id="navigation-bar">
                        <ul>
                            <li><a href="#"><i className="fa fa-home"></i><span>Home</span></a></li>
                            <li><a href="#"><i className="fa fa-handshake"></i><span>Services</span></a></li>
                            <li><a href="#"><i className="fa fa-user"></i><span>About</span></a></li>
                            <li><a href="#"><i className="fa fa-book"></i><span>Contact</span></a></li>
                            <li><a href="#"><i className="fa fa-rss"></i> <span>Blog</span></a></li>
                        </ul>
                    </div>

                </div>

            </div>
        );
    }
}



export default Navi;
